import React , { useState } from 'react';

function App(){
  
  const [inputList , setInputList] = useState();

  function onChangeGet(event){
    setInputList(event.target.value)
  }

  return(
    <React.Fragment>
      <div className='main_div'>
        <div className='center_div'>
          <br />
          <h1> ToDo List</h1>
          <input type='text' placeholder='Add a Items' onChange={onChangeGet} />
          <button onClick={onClickGet}> + </button>
          <ol>
            <li>{inputList}</li>
          </ol>
        </div>
      </div>
    </React.Fragment>
    
  )
}

export default App;
